        return (
          <div>  
            <TaskList todos={todos}/>   
            <input type = "text"></input>
            <button id= "add">Add Todo </button> 
            <button id= "delete">  Delete Todo </button>
            <div id="left"> 0 left to do </div>
          </div>
        );

}


export default Main;
